configuration-as-code: {
  }
credentials:
  folder: {
    }
  operationsCenter: {
    }
  providerImpl: {
    }
  system:
    domainCredentials:
    - domain: {
        }
  user: {
    }
jenkins:
  authorizationStrategy:
    loggedInUsersCanDoAnything:
      allowAnonymousRead: false
  clouds:
  - "operationsCenterAgentProvisioningService"
  crumbIssuer:
    standard:
      excludeClientIPFromCrumb: false
  disableRememberMe: false
  labelAtoms:
  - name: "agent1"
  - name: "built-in"
  - name: "linux"
  log: {
    }
  markupFormatter: "plainText"
  mode: NORMAL
  noUsageStatistics: true
  nodeMonitors:
  - "architecture"
  - "clock"
  - diskSpace:
      freeSpaceThreshold: "1GiB"
      freeSpaceWarningThreshold: "2GiB"
  - "swapSpace"
  - tmpSpace:
      freeSpaceThreshold: "1GiB"
      freeSpaceWarningThreshold: "2GiB"
  - "responseTime"
  nodes:
  - permanent:
      labelString: "linux"
      launcher:
        inbound:
          workDirSettings:
            disabled: false
            failIfWorkDirIsMissing: false
            internalDir: "remoting"
      name: "agent1"
      nodeDescription: "Linux Agent"
      numExecutors: 2
      remoteFS: "/var/lib/jenkins-agent"
      retentionStrategy: "always"
  numExecutors: 0
  primaryView:
    all:
      name: "all"
  projectNamingStrategy: "standard"
  quietPeriod: 5
  remotingSecurity:
    enabled: true
  scmCheckoutRetryCount: 0
  securityRealm:
    local:
      allowsSignup: false
      enableCaptcha: false
      users:
      - id: "terralogic1"
        name: "Channammarani Biradar"
        properties:
        - "consoleUrlProvider"
        - "viewsTabBar"
        - myView:
            viewsTabBar: "standard"
        - preferredProvider:
            providerId: "default"
        - "timezone"
        - "experimentalFlags"
        - mailer:
            emailAddress: "sbiradarchannamma@gmail.com"
        - "apiToken"
  slaveAgentPort: 50001
  updateCenter:
    sites:
    - id: "core-cm-offline"
      url: "file:/var/cache/cloudbees-core-cm/war/WEB-INF/plugins/update-center.json"
    - id: "cap-core-cm"
      url: "https://jenkins-updates.cloudbees.com/update-center/envelope-core-cm/update-center.json"
  views:
  - all:
      name: "all"
  viewsTabBar: "standard"
cloudbees-monitoring: {
  }
advisor:
  acceptToS: true
  email: "channammarani.biradar@terralogic.com"
  excludedComponents:
  - "AgentsSystemConfiguration"
  - "AgentsJVMProcessSystemMetricsContents"
  - "AgentsConfigFile"
  - "ConfigFileComponent"
  - "SlaveLogs"
  - "OtherConfigFilesComponent"
  - "SlaveLaunchLogs"
  nagDisabled: false
beekeeper:
  enabled: true
  securityWarnings:
    enabledForCore: true
    enabledForPlugins: true
  upgrades:
    autoDowngradePlugins: false
    autoUpgradePlugins: true
notificationConfiguration:
  enabled: true
globalCloudBeesPipelineTemplateCatalog: {
  }
